const container = (props) => {

    return (
        <div style={{height:"90px",width:"100%",backgroundColor:"yellow"}}> 
            <h1>block  </h1>
    <p>my name is {props.name}</p>
    <p>{props.children}</p>
         </div>
    );
};
export default container;
